import React from 'react';
import events from '../data/EventsData'; // Ensure this file contains your event data with latitude and longitude
import MapComponent from '../components/MapComponent';

const Events = () => {
  const [selectedEvent, setSelectedEvent] = useState(null);

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold mb-6">Upcoming Events</h1>
      <MapComponent selectedEvent={selectedEvent} />
      <div className="grid gap-6 mt-6">
        {events.map(event => (
          <div 
            key={event.id} 
            className="bg-white p-4 rounded-lg shadow-lg cursor-pointer"
            onClick={() => setSelectedEvent(event)}
          >
            <h2 className="text-xl font-semibold mb-2">{event.name}</h2>
            <p><strong>Date:</strong> {event.date}</p>
            <p><strong>Time:</strong> {event.time}</p>
            <p><strong>Host:</strong> {event.host}</p>
            <p><strong>Location:</strong> {event.location}</p>
            <p><strong>Cost:</strong> {event.cost}</p>
            <p><strong>Attendees:</strong> {event.attendees}/{event.capacity}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Events;
